import "./BottomNav.css";

import React from "react";

export default function BottomNav(){
    return(
        <>
        <div id="buttonsWrapper">
            <div id="buttons">
                <button class="navButton2" id="backBtn">
                    Back
                </button>
                <button class="navButton1" id="nextBtn">
                    Next
                </button>
            </div>
        </div>
        </>
    );
}
